import React from "react";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import MenShoes from "./Pages/MenShoes/MenShoes";
import MenJordan from "./Pages/MenJordan/MenJordan";
import WomenShoes from "./Pages/WomenShoes/WomenShoes";
import WomenRunning from "./Pages/WomenRunning/WomenRunning";
import ItemDetail from "./Pages/ItemDetail/ItemDetail";
import Main from "./Pages/Main/Main";
import SignUp from "./Pages/SignUp/SignUp";

class Routes extends React.Component {
  render() {
    return (
      <Router>
        <Switch>
          <Route exact path="/" component={MenShoes} />
          <Route exact path="/Main" component={Main} />
          <Route exact path="/MenJordan" component={MenJordan} />
          <Route exact path="/WomenShoes" component={WomenShoes} />
          <Route exact path="/WomenRunning" component={WomenRunning} />
          <Route exact path="/ItemDetail" component={ItemDetail} />
          <Route exact path="/SignUp" component={SignUp} />
        </Switch>
      </Router>
    );
  }
}

export default Routes;
